// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.4;

contract Bet {

    struct Result {
        uint256 amount;
        uint8 home;
        uint8 away;
    }


    address private _manager;
    uint32 private _matchId;
    uint8 private constant maxParticipants = 3;
    mapping(address => Result) _participants;
    address[] private _participantList;
    uint32 private _minAmount;

    constructor(address manager, uint32 matchId, uint32 minAmount){
        _manager = manager;
        _matchId = matchId;
        _minAmount = minAmount;
    }

    modifier requireManager(){
        require(msg.sender == _manager, "0x001: You must be the manager");
        _;
    }


    function getMatchId() public view returns(uint32){
        return _matchId;
    }

    function getManager() public view returns(address){
        return _manager;
    }

    function placeBet(uint8 home, uint8 away) public payable {
        require(msg.value > _minAmount, "0x002: Need to give more ether");
        Result memory actual = _participants[msg.sender];
        require(actual.amount == 0, "0x003: Already on the bet");
        require(_participantList.length < maxParticipants, "0x004: Too much participants");
        _participants[msg.sender] = Result({amount: msg.value, home: home, away: away});
        _participantList.push(msg.sender);
    }

    function findWinner(uint8 home, uint8 away) public requireManager {
        address[] memory winners = new address[](maxParticipants);
        uint8 count = 0;
        for(uint8 i = 0; i < _participantList.length; i++){
            address participant = _participantList[i];
            Result memory participantResult = _participants[participant];
            assert(participantResult.amount > 0);
            if(home == participantResult.home && away == participantResult.away){
                winners[count++] = participant;
            }
        }
        uint amount = address(this).balance / count;
        for(uint8 i = 0; i < count; i++){
            address payable winner = payable(winners[i]);
            winner.transfer(amount);
        }
    }   
}
